    footer: {
      backgroundColor: "#FF6347",
      display: "flex",
      minHeight: "100vh",
      flexDirection: "column"
    },
}));

export default function Footer() {
    const { footer } = useStyles();

    return (
        <AppBar className={footer}>
            <Toolbar>ForgeRock</Toolbar>
        </AppBar>
    )
}
